import{_ as r,c as e,o as t,a}from"./app.d0234d09.js";const f='{"title":"1985/11/27 - \u91E7\u8DEF\u5E02\u6C11\u6587\u5316\u6703\u9928","description":"","frontmatter":{},"headers":[],"relativePath":"Live/19851127.md","lastUpdated":1668301660792}',o={},_=a('<h1 id="_1985-11-27-\u91E7\u8DEF\u5E02\u6C11\u6587\u5316\u6703\u9928" tabindex="-1">1985/11/27 - \u91E7\u8DEF\u5E02\u6C11\u6587\u5316\u6703\u9928 <a class="header-anchor" href="#_1985-11-27-\u91E7\u8DEF\u5E02\u6C11\u6587\u5316\u6703\u9928" aria-hidden="true">#</a></h1><p>\u9019\u662FOZAKI\u5341\u4EE3\u6700\u5F8C\u4E00\u5834\u7684\u6F14\u5531\u6703\u3002\u9019\u5929\u7684\u5165\u5EA7\u7387\u53EA\u6709\u4E94\u6210\u5DE6\u53F3\uFF0C\u53EF\u5BB9\u7D0D1500\u4EBA\u7684\u5730\u65B9\u53EA\u6709800\u4EBA\u5165\u5EA7\u3002\u4E0D\u904E\uFF0C\u4EE5\u4EBA\u53E3\u6BD4\u7387\u4F86\u8A08\u7B97\uFF0C\u5728\u90A3\u7A2E\u5C0F\u5730\u5340\uFF0C\u9019\u5DF1\u662F\u5F88\u4E0D\u932F\u4E86\u3002</p><p>\u9019\u5929\uFF0C\u5728\u5531\u51FA\u300C\u5341\u4E94\u4E4B\u591C\u300D\u524D\uFF0COZAKI\u8AAA\u4E86\u4EE5\u4E0B\u7684\u8A71\uFE55</p><hr><blockquote><p>\u6700\u8FD1\u50D5\u306E\u4EF2\u9593\u306E\uFF11\u4EBA\u304C\u6B7B\u3093\u3067\u3057\u307E\u3063\u3066\u3001\u81EA\u5206\u306E\u5F31\u3055\u306B\u8CA0\u3051\u3066\u3001\u305D\u3044\u3064\u306F\u4FFA\u306A\u3093\u304B\u3088\u308A\u3082\u305A\u3063\u3068\u4EBA\u3042\u305F\u308A\u304C\u30A4\u30A4\u3084\u3064\u3067\u4EF2\u9593\u3082\u591A\u304B\u3063\u305F\u3002<br> \u305D\u308C\u306A\u306E\u306B\u6BCE\u6669\u3044\u3063\u3057\u3087\u306B\u3044\u305F\u4FFA\u9054\u3067\u3059\u3089\u3001\u305D\u3044\u3064\u306E\u5FC3\u306E\u53EB\u3073\u3092\u805E\u3044\u3066\u3042\u3052\u308B\u3053\u3068\u304C\u3067\u304D\u306A\u304B\u3063\u305F\u3002<br> \u5C11\u306A\u304F\u3068\u3082\u3001\u307F\u3093\u306A\u4F55\u304B\u3092\u5B88\u308B\u305F\u3081\u306B\u81EA\u5206\u306E\u5FC3\u306E\u306A\u304B\u306E\u4F55\u304B\u3068\u3044\u3064\u3082\u95D8\u3063\u3066\u3044\u308B\u3093\u3060\u3068\u601D\u3046\u3002<br> \u6700\u8FD1\u3001\u3053\u3093\u306A\u3053\u3068\u3092\u8003\u3048\u3066\u3044\u308B\u3068\u3002\u81EA\u5206\u4EE5\u5916\u306E\u3059\u3079\u3066\u306E\u51FA\u6765\u4E8B\u304C\u81EA\u5206\u3092\u5199\u3059\u93E1\u306E\u3088\u3046\u306B\u601D\u3048\u3066\u304D\u305F\u3002<br> \u305D\u308C\u304C\u81EA\u5206\u306B\u306F\u306D\u8FD4\u3063\u3066\u304D\u305F\u6642\u3001\u679C\u305F\u3057\u3066\u672C\u5F53\u306B\u81EA\u5206\u306F\u4EBA\u3092\u611B\u3057\u3066\u3044\u308B\u3060\u308D\u3046\u304B\u3063\u3066\u3001\u81EA\u5206\u304C\u3068\u3066\u3082\u5ACC\u306A\u4EBA\u9593\u306B\u898B\u3048\u3066\u4ED5\u65B9\u304C\u306A\u304B\u3063\u305F<br> \u4EBA\u3092\u611B\u3059\u308B\u305F\u3081\u306B\u81EA\u5206\u306F\u547D\u3092\u304B\u3051\u3066\u4EBA\u3068\u63A5\u3057\u3066\u3044\u304B\u306A\u3051\u308C\u3070\u3044\u3051\u306A\u3044\u3093\u3058\u3083\u306A\u3044\u304B\u3063\u3066<br> \u5C11\u306A\u304F\u3068\u3082\u81EA\u5206\u306B\u4F55\u304B\u4E0E\u3048\u3066\u304F\u308C\u308B\u4EBA\u3084\u3001\u81EA\u5206\u306B\u89E6\u308C\u5408\u3046\u4EBA\u306B\u5BFE\u3057\u3066\u3001\u81EA\u5206\u3092\u611B\u3059\u308B\u306E\u3092\u540C\u3058\u3088\u3046\u306B\u4EBA\u3092\u611B\u3057\u3066\u3044\u304B\u306A\u3051\u308C\u3070\u3044\u304B\u306D\u3044\u3093\u3058\u3083\u306A\u3044\u304B\u3063\u3066\u601D\u3063\u3066\u308B\u3002<br> \u3060\u304B\u3089\u5C11\u306A\u304F\u3068\u3082\u3001\u305D\u3093\u306A\u4EBA\u306E\u305F\u3081\u306B\u306F\u547D\u3092\u5F35\u3063\u3066\u3044\u304D\u305F\u3044\u3068\u601D\u3063\u3066\u308B\u3002<br> \u3053\u308C\u306F\u3001\u4FFA\u306B\u3068\u3063\u3066\u306F\u3082\u3046\u5927\u3052\u3055\u306A\u3053\u3068\u3067\u3082\u306A\u3044\u3093\u3060<br> \u5931\u3046\u3082\u306E\u306E\u591A\u3055\u306B\u81EA\u5206\u304C\u8CA0\u3051\u3066\u3057\u307E\u3046\u304B\u3082\u3057\u308C\u306A\u3044\u3001\u3060\u3051\u3069\u4EBA\u3092\u611B\u3059\u308B\u307B\u3046\u304C\u3082\u3063\u3068\u5927\u5207\u306A\u3053\u3068\u306A\u3093\u3058\u3083\u306A\u3044\u304B\u3063\u3066\u601D\u3063\u3066\u308B<br> \u4ECA\u591C\u3053\u3053\u307E\u3067\u96C6\u307E\u3063\u3066\u304F\u308C\u3066\u3069\u3046\u3082\u3042\u308A\u304C\u3068\u3046</p></blockquote><p>\u6700\u8FD1\uFF0C\u6211\u7684\u4E00\u500B\u53CB\u4F34\u6B7B\u4E86\u2026\u2026\u8F38\u7D66\u81EA\u5DF1\u7684\u61E6\u5F31\u2026\uFF0C\u90A3\u50A2\u4F19\u7684\u4EBA\u54C1\u4E00\u5411\u4E5F\u6BD4\u6211\u597D\uFF0C\u670B\u53CB\u4E5F\u5F88\u591A\u3002<br> \u5118\u7BA1\u5982\u6B64\uFF0C\u6BCF\u665A\u8DDF\u4ED6\u5728\u4E00\u8D77\u7684\u6211\u5011\u4E5F\u7121\u6CD5\u807D\u5230\u90A3\u50A2\u4F19\u5FC3\u4E2D\u7684\u53EB<br> \u81F3\u5C11\uFF0C\u6211\u8A8D\u70BA\u6240\u6709\u4EBA\u90FD\u70BA\u4E86\u5B88\u8B77\u67D0\u4E9B\u6771\u897F\u800C\u7E3D\u662F\u5728\u81EA\u5DF1\u7684\u5FC3\u4E2D\u8DDF\u67D0\u4E9B\u6771\u897F\u6230\u9B25\u3002<br> \u6700\u8FD1\uFF0C\u6211\u90FD\u5728\u60F3\u8457\u9019\u7A2E\u4E8B\u3002\u6211\u958B\u59CB\u80FD\u5920\u8996\u6211\u4EE5\u5916\u767C\u751F\u7684\u4E00\u5207\u70BA\u53CD\u7167\u81EA\u5DF1\u7684\u93E1<br> \u4EE5\u90A3\u500B\u53BB\u53CD\u7167\u81EA\u5DF1\u7684\u6642\u5019\uFF0C\u5C31\u6703\u60F3\uFF0C\u5230\u5E95\u81EA\u5DF1\u6709\u6C92\u6709\u771F\u7684\u53BB\u611B\u4EBA\u5462\u2026\u2026\u4E26\u6DF1\u5207\u5730\u89BA\u5F97\u81EA\u5DF1\u662F\u975E\u5E38\u8A0E\u53AD\u7684\u4EBA\u3002<br> \u6211\u60F3\uFF0C\u6211\u5FC5\u9808\u63A5\u89F8\u70BA\u4E86\u611B\u4EBA\u800C\u8C41\u51FA\u81EA\u5DF1\u751F\u547D\u7684<br> \u81F3\u5C11\u6211\u89BA\u5F97\u5C0D\u8457\u7D66\u4E86\u81EA\u5DF1\u4E9B\u6771\u897F\u7684\u4EBA\u548C\u8DDF\u81EA\u5DF1\u63A5\u89F8\u7684\u4EBA\uFF0C\u6211\u5011\u5FC5\u9808\u8981\u50CF\u611B\u81EA\u5DF1\u822C\u53BB\u611B\u4ED6\u5011\u3002<br> \u6240\u4EE5\uFF0C\u81F3\u5C11\u6211\u60F3\u70BA\u90A3\u7A2E\u4EBA\u53BB\u62DA\u547D\u3002<br> \u9019\u5C0D\u6211\u4F86\u8AAA\uFF0C\u4E26\u4E0D\u662F\u751A\u9EBC\u8A87\u5F35\u7684\u4E8B\u3002<br> \u4E5F\u8A31\u6703\u70BA\u5931\u53BB\u592A\u591A\u800C\u5FC3\u7070\uFF0C\u4F46\u6211\u9084\u662F\u89BA\u5F97\uFF0C\u611B\u4EBA\u662F\u6BD4\u8F03\u91CD\u8981\u5427\u3002<br> \u4ECA\u591C\uFF0C\u4F60\u5011\u70BA\u6211\u800C\u805A\u96C6\u5728\u6B64\uFF0C\u975E\u5E38\u611F\u8B1D\u4F60\u5011\u2026\u2026</p><hr><p>\u540D\u70BALAST TEENAGE APPEARANCE\u7684TOUR\uFF0C\u5C31\u5728\u9019\u591C\u843D\u5E55\u3002</p><hr><p>\u8F49\u8F09\u81EA:</p><ul><li><a href="http://web.archive.org/web/20110429214120/http://blog.yam.com/forgetnot/category/634985" target="_blank" rel="noopener noreferrer">1985\u5E7411\u670827\u65E5 \u91E7\u8DEF</a></li><li><a href="https://matagorou.hatenablog.com/entry/37005209" target="_blank" rel="noopener noreferrer">\u91E7\u8DEF\u5E02\u6C11\u6587\u5316\u4F1A\u9928</a></li></ul>',11),n=[_];function p(b,c,l,s,i,h){return t(),e("div",null,n)}var u=r(o,[["render",p]]);export{f as __pageData,u as default};
